import React, { useState, useEffect } from "react";
import { getOrderByOrderNo } from "../API/OrderDetailsApi";  // Import the API function

const ShowOrderDetails = ({ OrderNo }) => {
  const [orderDetails, setOrderDetails] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch order details on component mount
  useEffect(() => {
    const fetchOrderDetails = async () => {
      try {
        const response = await getOrderByOrderNo(OrderNo);  // Call the API with the OrderNo
        if (response.data && Array.isArray(response.data)) {
          setOrderDetails(response.data);  // Set the fetched data to state
        } else {
          setError("No order details found.");
        }
      } catch (err) {
        setError("Error fetching order details.");
        console.error("Error fetching order details:", err);
      } finally {
        setLoading(false);  // Set loading state to false after data is fetched
      }
    };

    if (OrderNo) {
      fetchOrderDetails();
    }
  }, [OrderNo]);  // Dependency array ensures this runs only when OrderNo changes

  // Show loading indicator while fetching
  if (loading) {
    return <p>Loading order details...</p>;
  }

  // Show error if fetching fails
  if (error) {
    return <p>{error}</p>;
  }

  // Render order details if available
  return (
    <div>
      <h2>Order Details for OrderNo: {OrderNo}</h2>
      {orderDetails.length > 0 ? (
        orderDetails.map((order, index) => (
          <div key={index}>
            <h3>Order {index + 1}: {order.MatchingName}</h3>
            <table>
              <thead>
                <tr>
                  <th>Field</th>
                  <th>Value</th>
                </tr>
              </thead>
              <tbody>
                {order.MatchingName && (
                  <tr>
                    <td>Matching Name</td>
                    <td>{order.MatchingName}</td>
                  </tr>
                )}
                {order.Freesize && (
                  <tr>
                    <td>Freesize</td>
                    <td>{order.Freesize}</td>
                  </tr>
                )}
                {order.XS && (
                  <tr>
                    <td>XS</td>
                    <td>{order.XS}</td>
                  </tr>
                )}
                {order.S && (
                  <tr>
                    <td>S</td>
                    <td>{order.S}</td>
                  </tr>
                )}
                {order.M && (
                  <tr>
                    <td>M</td>
                    <td>{order.M}</td>
                  </tr>
                )}
                {order.L && (
                  <tr>
                    <td>L</td>
                    <td>{order.L}</td>
                  </tr>
                )}
                {order.XL && (
                  <tr>
                    <td>XL</td>
                    <td>{order.XL}</td>
                  </tr>
                )}
                {order["2XL"] && (
                  <tr>
                    <td>2XL</td>
                    <td>{order["2XL"]}</td>
                  </tr>
                )}
                {order["3XL"] && (
                  <tr>
                    <td>3XL</td>
                    <td>{order["3XL"]}</td>
                  </tr>
                )}
                {order["4XL"] && (
                  <tr>
                    <td>4XL</td>
                    <td>{order["4XL"]}</td>
                  </tr>
                )}
                {order["5XL"] && (
                  <tr>
                    <td>5XL</td>
                    <td>{order["5XL"]}</td>
                  </tr>
                )}
                {order.Total && (
                  <tr>
                    <td>Total</td>
                    <td>{order.Total}</td>
                  </tr>
                )}
                {order.UserId && (
                  <tr>
                    <td>UserId</td>
                    <td>{order.UserId}</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        ))
      ) : (
        <p>No order details found.</p>
      )}
    </div>
  );
};

export default ShowOrderDetails;
